import React from 'react';
import Genre from './Genre/Genre';

const GenreList = ({ genres, getG }) => {
    return (
        <div className="podcast-container">
            {
                genres.map(genre => {
                    return <Genre 
                        key={genre.id}
                        id={genre.id}
                        name={genre.name}
                        subgenres={genre.subgenres}
                    />
                })
            }
        </div>
    )    
}

export default GenreList;
